import React from 'react';
import { Grid, Paper, Typography } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import Button from "./components/button";



const TitleComponent = () => (
  <Grid item xs={12} style={{ height: 500 }}>
          <div style={{ textAlign: 'center' }}>
            <img src="/images/airplane.jpg" style={{ width: '100%', height: '70%', objectFit: 'cover', position: 'absolute', top: 0, left: 0, zIndex: -1, opacity: 0.5 }} />
            <Typography variant="h1" style={{ color: 'black', fontWeight: 'bold' }}>セクションのタイトル</Typography>
          </div>
      </Grid>
);

const App = () => {
  const navigate = useNavigate()
  const handleForm = () => {
        navigate('/Form')
    }
  const handleView = () => {
        navigate('/View')
    }
  return (
    <div>
    <Header />
    <TitleComponent />
    <Grid container spacing={6} justifyContent="center" style={{ marginTop: 64, marginBottom: 64 }}>


      <div style={{ display: 'grid', gap: '50px' }}>
      <Button to="/Form"><h1>投稿画面へ</h1></Button>
      <Button to="/Form"><h1>投稿画面へ</h1></Button>
      <Button to="/Form"><h1>投稿画面へ</h1></Button>
      <Button to="/Form"><h1>投稿画面へ</h1></Button>
      </div>

    </Grid>
    <Footer />
    </div>

  );
};

export default App;
